import React from 'react'
import { connect } from 'react-redux'; //^ Binding action step 1
import { hello } from '../../redux/asset/asset.actions'; //^ Binding action step 2

import './left.styles.scss'

import AssetDropDown from '../custom-drop-down/asset-drop-down.component';
import UserDropDown from "../custom-drop-down/user-drop-down.component";
import CustomTag from '../custom-tag/custom-tag.component'





//^ Binding action step 5, we are now able to access toggleCartHidden here
const Left = ({hello}) => {
    return (
        <div className='left'>
            <div className='left-inner'>
                <CustomTag>Scan Tag Span</CustomTag>
                <AssetDropDown>Scan Asset</AssetDropDown>
                
                <CustomTag>Scan User Name Span</CustomTag>
                <UserDropDown>Scan User</UserDropDown>
                <button onClick={() => {console.log(typeof hello)} }> Click me for all tests</button>
            </div>
        </div>
    )
}

//^ Binding action step 3
const mapDispatchToProps = dispatch => ({
    hello: () => dispatch(hello())
})

//^ Binding action step 4
export default connect(mapDispatchToProps)(Left);
